import Link from "next/link";

const Menu = () => {
  return (
    <div className="menu">
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/about">
        <a>About</a>
      </Link>
      <Link href="/design">
        <a>Design</a>
      </Link>
      <style jsx>{`
        .menu {
          font-family: "Arial";
          display: flex;
          flex-direction: column;
          width: 10vw;
        }
        a {
          padding: 20px;
          color: black;
          font-size: 1.5em;
        }
        a:hover {
          background-color: black;
          color: white;
          text-decoration: none;
        }
      `}</style>
    </div>
  );
};

export default Menu;
